(defquery ind-bat-opt [prob]
  (let [a (+ 1 (sample (poisson 1)))
        b (+ 1 (sample (poisson 1)))]
    (observe (beta a b) prob)
    (sample (beta a b))))

(defn sample-prob [i n]
  (let [data (vote-ith i)
        freq (reduce + 0 data)
        len (count data)
        prob (/ freq len)]
    (map :result (take n (take-nth 10 (drop 1000 (doquery :ipmcmc ind-bat-opt [prob])))))))
