;; @@
(defquery inference  [probs]
  (let [a (+ 1 (sample (poisson 1))) ; parameter for trans.
        b (+ 1 (sample (poisson 1))) ; parameter for trans.
        trans (sample (beta a b))]
    (loop [sum 0
           ps probs]
      (if (empty? ps)
        (do
          (observe (normal sum 4) 140)
          trans)
        (let [p-con (* (first ps) trans)
              is-con (if (sample (flip p-con)) 1 0)]
              (recur (+ sum is-con)
                   (rest ps)))))))
(defquery inference22 [probs]
  (let [a (+ 1 (sample (poisson 1))) ; parameter for trans.
        b (+ 1 (sample (poisson 1))) ; parameter for trans.
        trans (sample (beta a b))]
    (loop [sum 0
           ps probs]
      (if (empty? ps)
        (do
          (observe (normal sum 4) 172)
          trans)
        (let [p-con (* (first ps) trans)
              is-con (if (sample (flip p-con)) 1 0)]
              (recur (+ sum is-con)
                   (rest ps)))))))
