(def trans-samples-yeom
  (vec
    (map :result
       (take 1000 (take-nth 50 (drop 1000 (doquery :ipmcmc inference22 [probs-yeom])))))))
(def trans-samples-hong
  (vec
    (map :result
       (take 1000 (take-nth 50 (drop 1000 (doquery :ipmcmc inference [probs-hong])))))))
